// Mark the notification as read
Patch(
    'Notifications List',
    SelectedNotification,
    {
        IsRead: true
    }
);

// Update the count of unread notifications
Set(
    UnreadNotificationCount,
    CountRows(
        Filter(
            'Notifications List',
            UserId = User().Email And !IsRead
        )
    )
);

